import React from 'react';
import PropTypes from 'prop-types';
import { LinkContainer } from "react-router-bootstrap";
import Card from 'react-bootstrap/Card'

function FreelancerCard(props) {
  let {
    freelancer
  } = props;


    return (
     <Card className="freelancer_card" key={freelancer.id}>
        {/* <div className="card_thumbnail"> */}
          <Card.Img src={freelancer.thumbnail} />
            {/* <img src={freelancer.thumbnail}/> */}
        {/* </div> */}
        {/* <div className="card_header"> */}
        <Card.Body>
            <Card.Title>{freelancer.name}</Card.Title>
            <Card.Subtitle>{freelancer.job_title}</Card.Subtitle>
            <Card.Text>
              {freelancer.sector} 
              {"\n"}
              {freelancer.full_day_rate}
            </Card.Text>
            {/* <h2>{freelancer.name}</h2>
            <h3>{freelancer.job_title}</h3>
            <p>{freelancer.sector}</p>
            <p className="price">{freelancer.full_day_rate}</p> */}
            <LinkContainer to={`freelancers/portfolio/id:${freelancer.id}`}>
              <button className="btn">See more</button>
            </LinkContainer>
          </Card.Body>
        {/* </div> */}
    </Card>
    );
}

FreelancerCard.propTypes = {
  freelancer: PropTypes.object.isRequired
};

export default FreelancerCard;
